column4:
if (e && e.key) {
  switch (e.key) {
    case 'ArrowUp':
      position.y -= 10;
      break;
    case 'ArrowDown':
      position.y += 10;
      break;
    case 'ArrowLeft':
      position.x -= 10;
      break;
    case 'ArrowRight':
      position.x += 10;
      break;
    default:
      break;
  }
}
